import React from 'react';
function Header (){
    return(
        <div className="bg-dark vw-100 h-20">
            <div className="p-4 text-center">
                <span className="text-light h2">COVID-19 TRACKER</span>
                <br></br>
                <span>SR direct</span>
            </div>
        </div>
    );
};
export default Header;
